function CurrentDeck() {
  const currentDeck = {
    name: "Deck name",
    description: "a brief deck description",
  };

	const deckControlButtons = (
    <Fragment>
			<button>Edit</button>
		</Fragment>
	);


  return (
    <Fragment>
      <h4>{currentDeck.name}</h4>
      <p>{currentDeck.description}</p>
      <h2>Cards</h2>
			{deckControlButtons}
    </Fragment>
  );
}

export default CurrentDeck;
